import Headers from "./pages/Headers";
import HomePage from "./pages/HomePage";

function App() {
  return (
    <div className="App">
    <Headers />
    <HomePage />
    <div style={{
      width: "100%",
      backgroundColor: "#f3",
      height: "700px"
    }}></div>
    <div style={{
      width: "100%",
      backgroundColor: "white",
      height: "700px"
    }}></div>
    <div style={{
      width: "100%",
      backgroundColor: "green",
      height: "700px"
    }}></div>
    </div>
  );
}

export default App;
